/**
 * Given an integer array nums and an integer k, return the kth largest element in the array.
 * Note that it is the kth largest element in the sorted order, not the kth distinct element.
 * 
 * Can you solve it without sorting?
 * 
 * Example 1:
 * Input: nums = [3,2,1,5,6,4], k = 2
 * Output: 5
 * 
 * Example 2:
 * Input: nums = [3,2,3,1,2,4,5,5,6], k = 4
 * Output: 4
*/

#include <iostream>
#include <vector>
#include <queue>
#include <algorithm>

using namespace std;

class Solution {
public:
    int findKthLargestViaSorting(vector<int>& nums, int k) {
        sort(nums.begin(), nums.end());
        return nums[nums.size() - k];
    }

    int findKthLargest(vector<int>& nums, int k) {
        priority_queue<int, vector<int>, greater<int>> minHeap;

        for (int num : nums) {
            minHeap.push(num);

            if (minHeap.size() > k)
                minHeap.pop();
        }
        return minHeap.top();
    }

    int findKthLargestUsingHoarePartition(vector<int>& nums, int k) {
        int left = 0;
        int right = nums.size() - 1;
        int result = INT_MIN;

        while (true) {
            int pivotIndex = partitionHoare(nums, left, right);

            if (pivotIndex == k - 1) {   // since nums is 0-based indexing
                result = nums[pivotIndex];
                break;
            }

            if (pivotIndex < k - 1)
                left = pivotIndex + 1;
            else 
                right = pivotIndex - 1;
        }
        return result;
    }

private:
    int partition(vector<int>& nums, int start, int end) {
        // Generate a random number between start and end
        srand(time(0));
        int randomIndex = start + rand() % (end - start + 1);

        // Swap the element at the random index with the element at the end
        swap(nums[randomIndex], nums[end]);

        int pivot = nums[end];
        int pivotIndex = start;

        for (int i = start; i < end; i++) {     // note that pivot is set to nums[end] and we run the loop till nums[end] - 1
            if (nums[i] >= pivot) {
                // Candidate nums[i] is greater than pivot
                // So swap and move it ahead (which is the pivotIndex)
                swap(nums[i], nums[pivotIndex]);
                pivotIndex++;
            }
        }
        // all elements to the left of pivotIndex are greater than pivot
        // swap nums[pivotIndex] with pivot to put pivot at the correct place
        swap(nums[pivotIndex], nums[end]);
        return pivotIndex;  // nums is partitioned at this index
    }

    int partitionHoare(vector<int>& nums, int start, int end) {
        int pivot = nums[start];
        int i = start;
        int j = end;

        while (i < j) {
            while (i < j && nums[j] <= pivot) {
                j--;
            }
            nums[i] = nums[j];
            while (i < j && nums[i] >= pivot) {
                i++;
            }
            nums[j] = nums[i];
        }
        nums[i] = pivot;
        return i;
    }
};


